import './App.css';
import AddFertilizer from './components/AddFertilizer';
import Header from './components/Header';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        <Header />
        <Routes>
          <Route path="/add" element={<AddFertilizer />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
